pub fn normalize_move_name(name: &str) -> String {
    name.to_ascii_lowercase().chars().filter(|c| c.is_ascii_alphanumeric()).collect()
}

pub fn get_move(name_or_id: &str) -> Option<&'static MoveData> {
    let id = normalize_move_name(name_or_id);
    MOVES.get(id.as_str())
}
